import Vue from 'vue';
import VueRouter from 'vue-router';

Vue.use(VueRouter);

const routes = [
    {
        path: '/',
        name: 'Layout',
        redirect: '/index',
    },
    {
        path: '/index',
        name: 'Index',
        component: () => import('@/views/indexPage')
    }
];

const router = new VueRouter({
    mode: 'history',
    routes
});

export default router;
